生まれたのは2日後の16日でした
 
夕方に破水し、7時くらいから
お産が始まり9時過ぎ10時には
終わった記憶です。

4匹生まれたのを確認し
観たい気持ちを抑えつつ
疲れたちゃいくろを
そっとしてあげました

私は寝不足の疲労もあり
無事出産が終わった安堵で
いつの間にか
寝てしまい…

真夜中頃に 仔猫の鳴き声に
目を覚ましました

？  どうした？ 何？
様子を見に行こうとした
その時、いきなり
ちゃいくろが生まれたばかりの
仔猫を咥えて連れてきたので
本当にびっくり‼️

えっ 何？
と、どうしていいのか
戸惑う私…

次から次へと
仔猫を連れてきたので
とりあえずダンボールに
バスタオルを敷き 仔猫達を
入れました

4匹 全て 運んだはずの
ちゃいくろが お産場所から
にゃーにゃーと鳴いています

すぐに行ってみると

なんと
明らかに他の仔猫達とは
大きさの違う とても小さな
仔猫が ぐったりしていました。
もう 息もしていない感じで…

まさかの5匹！

信じられない思いで
仔猫を抱き上げると
体温も冷たく…

きっと もう無理だ
気がついてあげれなくて
可哀想…  後悔しました

両手で抱えて何とか
助けてと願いながら温め
ましたが  本当に小さい

全然 動いてない

仔猫用の粉ミルクを
開店と同時に購入して
スポイトで与えてみると
少し 反応があったので
本当に嬉しかった

それから
丸2日間、うたた寝しながらも
その小さな仔猫をずっと
両手で抱えて温め続けました

